import "./App.css";
// importing components from react-router-dom package
import {
    BrowserRouter as Router,
    Routes,
    Route,
    Navigate,
} from "react-router-dom";
import PDP from "./PDP";

function App() {
    return (
        <>
        <a>Hello</a>
            <Router>
                <Routes>
                    <Route
                        exact
                        path="/profile"
                        element={<PDP />}
                    />
                </Routes>
            </Router>
        </>
    );
}

export default App;
